import React from "react";
import { ReactComponent as returnArrow } from "./Assets/Arrow.svg";

const ReturnArrow = (props) => {
  return (
    <div className="returnArrowContainer">
      <returnArrow />
    </div>
  );
};

export default ReturnArrow;
